import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import GridList from "@material-ui/core/GridList";
import Card from "./Card";
import cardsData from "./NewCard";
import Typography from "@material-ui/core/Typography";

const cardComponents = cardsData.map(item => (
  <Card key={item.id} card={item} />
));

const useStyles = makeStyles(theme => ({
  root: {
    justifyContent: "space-around",
    margin: "90px",
    marginTop: "50px"
  }
}));

export default function SingleLineGridList() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <GridList className={classes.gridList} cellHeight={600}>
        {cardsData.map(item => (
          <Grid item xs zeroMinWidth column>
            <Typography noWrap>{cardComponents.shift(1)}</Typography>
          </Grid>
        ))}
      </GridList>
    </div>
  );
}
